import React, { Component } from 'react';
import { useState}  from 'react';

import './App.css';
import axios from 'axios';
import { NavLink, Switch, Route } from 'react-router-dom';
import './App.css';
import styles from './mystyle.module.css'
import navstyle from './navbarcss.css'
import ReactDOM, {render} from 'react-dom';
import PropTypes from 'prop-types';
import {Navbar, Nav, NavItem, NavDropdown,Form,FormControl,Button} from 'react-bootstrap';
import { DropdownMenu ,MenuItem} from 'react-bootstrap-dropdown-menu';
import { Collapse, CardBody, Card } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';



class Test_NavigationBarComp extends Component {
// 1st element.
Navigationclass = () => (
   <nav>
     <ul className={styles.NaviText}>
       <li><NavLink exact activeClassName="current" to='/'>Home</NavLink></li>
       <li><NavLink exact activeClassName="current" to='/about'>About</NavLink></li>
       <li><NavLink exact activeClassName="current" to='/contact'>Contact</NavLink></li>
     </ul>
   </nav>
 );

NavigationBarComp = () => {
// 1st element.
   [isOpen1, setIsOpen1] = useState(false);
   toggle1open = () => {
    if(isOpen1 == true)
    {
      // opened already, no need to open again.
      // to close, because it is already open.
      setIsOpen1(false);
    }
    else {
      // isOpen1 is false.
      // need to open now.
      setIsOpen1(true);
    }
  }
   toggle1close = () => {
    if(isOpen1 == true)
    {
      // opened already, no need to open again.
      // need to close.
      setIsOpen1(false);
    }
    else { // isOpen1 is false.
      // closed already.
    }
  }
   [collapse1, setCollapse1] = useState(false);

// 2nd element.
   [isOpen2, setIsOpen2] = useState(false);
   toggle2open = () => {
    if(isOpen2 == true)
    {
      // opened already, no need to open again.
      // to close, because it is already open.
      setIsOpen2(false);
    }
    else {
      // isOpen2 is false.
      // need to open now.
      setIsOpen2(true);
    }
  }
   toggle2close = () => {
    if(isOpen2 == true)
    {
      // opened already, no need to open again.
      // need to close.
      setIsOpen2(false);
    }
    else { // isOpen2 is false.
      // closed already.
    }
  }
   [collapse2, setCollapse2] = useState(false);

// 3rd element.
   [isOpen3, setIsOpen3] = useState(false);
   toggle3open = () => {
 if(isOpen3 == true)
   {
     // opened already, no need to open again.
     // to close, because it is already open.

     setIsOpen3(false);

   }
   else {
     // isOpen3 is false.
     // need to open now.
     setIsOpen3(true);
   }
 }
  toggle3close = () => {
 if(isOpen3 == true)
 {
   // opened already, no need to open again.
   // need to close.
   setIsOpen3(false);
 }
 else { // isOpen3 is false.
   // closed already.
 }
}
   [collapse3, setCollapse3] = useState(false);

// 4th element.
    [isOpen4, setIsOpen4] = useState(false);
    toggle4open = () => {
     if(isOpen4 == true)
     {
       // opened already, no need to open again.
       // to close, because it is already open.
       setIsOpen4(false);
     }
     else {
       // isOpen4 is false.
       // need to open now.
       setIsOpen4(true);
     }
   }
    toggle4close = () => {
     if(isOpen4 == true)
     {
       // opened already, no need to open again.
       // need to close.
       setIsOpen4(false);
     }
     else { // isOpen4 is false.
       // closed already.
     }
   }
   [collapse4, setCollapse4] = useState(false);

}
render(){
  return (
    <nav>
      <ul className={styles.NaviText}>
      <li className={styles.Navielements} onClick={this.toggle1open} onMouseLeave = {this.toggle1close}>
      <button id="btnFile" className={styles.btnclass}>FILE</button>
      <Collapse className={styles.collapse} isOpen={this.isOpen1}>
      <ul className={styles.DropdownNavi}>
        <li><NavLink exact activeClassName="current" to='/'>Home1</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/about'>About1</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/contact'>Contact1</NavLink></li>
     </ul>
      </Collapse>
      </li>

      <li className={styles.Navielements} onClick={this.toggle2open} onMouseLeave = {this.toggle2close}>
      <button className={styles.btnclass}>EDIT</button>
      <Collapse className={styles.collapse} isOpen={this.isOpen2}>
      <ul className={styles.DropdownNavi}>
        <li><NavLink exact activeClassName="current" to='/'>Home2</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/about'>About2</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/contact'>Contact2</NavLink></li>
     </ul>
      </Collapse>
      </li>

      <li className={styles.Navielements} onClick={this.toggle3open} onMouseLeave = {this.toggle3close}>
      <button className={styles.btnclass}>VIEW</button>
      <Collapse className={styles.collapse} isOpen={this.isOpen3}>
      <ul className={styles.DropdownNavi}>
        <li><NavLink exact activeClassName="current" to='/'>Home3</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/about'>About3</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/contact'>Contact3</NavLink></li>
     </ul>
      </Collapse>
      </li>

        <li className={styles.Navielements} onClick={this.toggle4open} onMouseLeave = {this.toggle4close}>
        <button className={styles.btnclass}>HELP</button>
        <Collapse className={styles.collapse} isOpen={this.isOpen4}>
        <ul className={styles.DropdownNavi}>
          <li><NavLink exact activeClassName="current" to='/'>Home4</NavLink></li>
          <li><NavLink exact activeClassName="current" to='/about'>About4</NavLink></li>
          <li><NavLink exact activeClassName="current" to='/contact'>Contact4</NavLink></li>
       </ul>
        </Collapse>
        </li>
        <li className={styles.Username}>
        <p className={styles.Username}>{this.props.name}</p>
        </li>

      </ul>

    </nav>


  );
}
}

export default Test_NavigationBarComp;
